import styled from 'styled-components'

const Header = styled.div`
display: flex;
flex-direction: row;
background-color: black;
color: white;
padding: 10px;
font-size: 25px;
font-weight: bold;
box-shadow: 0 3px 6px 0 #555;
`;

const AppName = styled.div`
display: flex;
flex-direction: row;
align-items: center;
`;





function App() {
  return (
    <Header><AppName>React Movie App</AppName></Header>
  );
}

export default App;
